import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import { AuthProvider } from './context/AuthContext';
import { useAuth } from './context/AuthContext';
import { useState } from 'react';

// Component imports
import Navbar from './components/Layout/Navbar';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Dashboard from './components/Dashboard/Dashboard';
import Calendar from './components/Calendar/Calendar';


const ProtectedRoute = ({ children }) => {
  const { isAuthenticated } = useAuth();
  return isAuthenticated ? children : <Navigate to="/login" />;
};

const PublicRoute = ({ children }) => {
  const { isAuthenticated } = useAuth();
  return !isAuthenticated ? children : <Navigate to="/dashboard" />;
};

// Theme configuration
const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#007AFF',
      light: '#339CFF',
      dark: '#0051A8',
    },
    secondary: {
      main: '#32CD32',
      light: '#5DFD5D',
      dark: '#228B22',
    },
    background: {
      default: '#F9F9F9',
      paper: '#FFFFFF',
    },
    text: {
      primary: '#2E2E2E',
      secondary: 'rgba(46, 46, 46, 0.7)',
    },
    error: {
      main: '#FF6B6B',
    },
    success: {
      main: '#32CD32',
    },
    divider: 'rgba(0, 122, 255, 0.1)',
  },
  typography: {
    fontFamily: [
      'Plus Jakarta Sans',
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      'Arial',
      'sans-serif',
    ].join(','),
    h1: {
      fontWeight: 700,
      letterSpacing: '-0.025em',
      lineHeight: 1.1,
    },
    h2: {
      fontWeight: 700,
      letterSpacing: '-0.02em',
      lineHeight: 1.2,
    },
    h3: {
      fontWeight: 600,
      letterSpacing: '-0.015em',
      lineHeight: 1.3,
    },
    h4: {
      fontWeight: 600,
      letterSpacing: '-0.01em',
      lineHeight: 1.3,
    },
    h5: {
      fontWeight: 600,
      letterSpacing: '-0.005em',
      lineHeight: 1.4,
    },
    h6: {
      fontWeight: 600,
      letterSpacing: 0,
      lineHeight: 1.4,
    },
    button: {
      fontWeight: 600,
      textTransform: 'none',
      letterSpacing: '0.02em',
    },
  },
  components: {
    MuiCssBaseline: {
      styleOverrides: {
        body: {
          backgroundColor: '#F9F9F9',
          color: '#2E2E2E',
          scrollbarColor: '#007AFF #F9F9F9',
          "&::-webkit-scrollbar, & *::-webkit-scrollbar": {
            width: 8,
          },
          "&::-webkit-scrollbar-thumb, & *::-webkit-scrollbar-thumb": {
            borderRadius: 8,
            backgroundColor: '#007AFF',
            minHeight: 24,
          },
          "&::-webkit-scrollbar-track, & *::-webkit-scrollbar-track": {
            backgroundColor: '#F9F9F9',
          },
        },
      },
    },
    MuiAppBar: {
      styleOverrides: {
        root: {
          background: 'rgba(0, 122, 255, 0.9)',
          backdropFilter: 'blur(20px)',
          borderBottom: '1px solid rgba(0, 122, 255, 0.1)',
        },
      },
    },
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 12,
          padding: '12px 24px',
          fontSize: '0.95rem',
          fontWeight: 600,
          transition: 'all 0.2s ease-in-out',
          textTransform: 'none',
        },
        contained: {
          background: 'linear-gradient(135deg, #007AFF 0%, #32CD32 100%)',
          boxShadow: '0 4px 14px 0 rgba(0, 122, 255, 0.15)',
          color: '#fff',
          '&:hover': {
            background: 'linear-gradient(135deg, #32CD32 0%, #007AFF 100%)',
            boxShadow: '0 6px 20px rgba(50, 205, 50, 0.2)',
            transform: 'translateY(-1px)',
          },
        },
        outlined: {
          borderWidth: '2px',
          borderColor: 'rgba(0, 122, 255, 0.5)',
          color: '#007AFF',
          '&:hover': {
            borderWidth: '2px',
            borderColor: '#32CD32',
            background: 'rgba(50, 205, 50, 0.08)',
          },
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 20,
          background: '#FFFFFF',
          border: '1px solid rgba(0, 122, 255, 0.1)',
          boxShadow: '0 4px 20px rgba(0, 0, 0, 0.05)',
          transition: 'all 0.3s ease-in-out',
          '&:hover': {
            transform: 'translateY(-5px)',
            boxShadow: '0 8px 30px rgba(0, 122, 255, 0.08)',
            border: '1px solid rgba(0, 122, 255, 0.2)',
          },
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            backgroundColor: '#F9F9F9',
            '& fieldset': {
              borderColor: 'rgba(0, 122, 255, 0.23)',
              borderWidth: '1px',
            },
            '&:hover fieldset': {
              borderColor: 'rgba(50, 205, 50, 0.5)',
            },
            '&.Mui-focused fieldset': {
              borderColor: '#007AFF',
            },
            '& input': {
              backgroundColor: 'transparent',
            },
            '& input:-webkit-autofill': {
              '-webkit-box-shadow': '0 0 0 30px #F9F9F9 inset !important',
              '-webkit-text-fill-color': '#2E2E2E !important',
              'caret-color': '#2E2E2E',
            },
          },
          '& .MuiInputLabel-root': {
            color: 'rgba(46, 46, 46, 0.7)',
          },
          '& .MuiInputBase-input': {
            color: '#2E2E2E',
          },
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          background: '#FFFFFF',
          borderRadius: 20,
        },
      },
    },
    MuiDialog: {
      styleOverrides: {
        paper: {
          borderRadius: 20,
          background: '#FFFFFF',
          backdropFilter: 'blur(10px)',
        },
      },
    },
    MuiLink: {
      styleOverrides: {
        root: {
          color: '#007AFF',
          textDecoration: 'none',
          transition: 'all 0.2s ease-in-out',
          '&:hover': {
            color: '#32CD32',
          },
        },
      },
    },
  },
  shape: {
    borderRadius: 12,
  },
});

function App() {
  const [isNavbarCollapsed, setIsNavbarCollapsed] = useState(false);
  const sidebarWidth = isNavbarCollapsed ? 64 : 220;
  return (
    <AuthProvider>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Router>
          <div className="App" style={{
            minHeight: '100vh',
            background: '#F9F9F9',
            display: 'flex',
            flexDirection: 'row',
          }}>
            <Navbar isCollapsed={isNavbarCollapsed} setIsCollapsed={setIsNavbarCollapsed} />
            <div style={{
              flex: 1,
              marginLeft: sidebarWidth,
              transition: 'margin-left 0.2s cubic-bezier(.4,0,.2,1)',
              minHeight: '100vh',
              display: 'flex',
              flexDirection: 'column',
            }}>
              <Routes>
                {/* Public routes */}
                <Route path="/" element={
                  <PublicRoute>
                    <Login />
                  </PublicRoute>
                } />
                <Route 
                  path="/register" 
                  element={
                    <PublicRoute>
                      <Register />
                    </PublicRoute>
                  } 
                />

                <Route 
                  path="/calendar" 
                  element={
                    <ProtectedRoute>
                      <Calendar />
                    </ProtectedRoute>
                  } 
                />  

                {/* Protected routes */}
                <Route 
                  path="/dashboard" 
                  element={
                    <ProtectedRoute>
                      <Dashboard />
                    </ProtectedRoute>
                  } 
                />

                {/* Fallback route */}
                <Route path="*" element={<Navigate to="/" />} />
              </Routes>
            </div>
          </div>
        </Router>
      </ThemeProvider>
    </AuthProvider>
  );
}

export default App;
